INSERT INTO `cakes` VALUES (1,NULL,'Pudding Cup','/assets/image/cakes/pudding-cup.png',5000.00,'Dessert mungil yang memanjakan, disajikan dalam cup transparan, menampilkan lapisan krim custard lembut dan topping buah segar yang menggoda. Cocok untuk Anda yang ingin menikmati hidangan manis personal, kapan saja dan di mana sajaâ€”baik sebagai teman ngemil atau penutup santap lezat Anda.','non-customized','2024-11-08 21:11:19','2024-11-08 21:11:19'),(2,NULL,'Cupcake (5 pcs)','/assets/image/cakes/cupcakes.png',45000.00,'Kue kecil yang meriah, dipanggang dalam wadah kertas dekoratif. Kue lembut ini hadir dalam berbagai rasa, dilengkapi dengan swirl frosting buttercream, taburan sprinkles, atau dekorasi yang bisa dimakan, menjadikannya sempurna untuk pesta atau sekadar memanjakan diri sendiri.','non-customized','2024-11-08 21:11:19','2024-11-08 21:11:19'),(3,NULL,'Pie Buah','/assets/image/cakes/pie-buah.png',150000.00,'Dessert klasik ala Amerika dengan kulit yang renyah keemasan, diisi dengan buah-buahan musiman yang manis dan segar seperti apel, beri, atau persik. Setiap gigitannya menghadirkan perpaduan tekstur yang sempurna dan sensasi rasa buah yang menyegarkan.','non-customized','2024-11-08 21:11:19','2024-11-08 21:11:19'),(4,NULL,'Cupcake (6 pcs)','/assets/image/cakes/cupcakes.png',50000.00,'Kue kecil yang meriah, dipanggang dalam wadah kertas dekoratif. Kue lembut ini hadir dalam berbagai rasa, dilengkapi dengan swirl frosting buttercream, taburan sprinkles, atau dekorasi yang bisa dimakan, menjadikannya sempurna untuk pesta atau sekadar memanjakan diri sendiri.','non-customized','2024-11-08 21:11:19','2024-11-08 21:11:19'),(5,NULL,'Fudge Brownies','/assets/image/cakes/fudge-brownies.png',40000.00,'Brownies cokelat pekat berbentuk persegi yang siap memanjakan lidah Anda! Tekstur yang fudgy dan lembut berpadu sempurna dengan rasa cokelat yang kaya dan intens. Cocok untuk dinikmati sendiri atau dibagi bersama teman dan keluarga. Tambahkan es krim atau whipped cream 